INSERT INTO `excercise_part` VALUES (1,2,1,4,'Hold a barbell with a slightly wider than shoulder-width grip, bending over at the hips and keeping your back straight. Let the bar hang down in front of you.'),(2,2,2,5,'Pull the barbell in to your upper chest in a controlled manner, focusing on contracting your rear delts. Repeat.'),(3,3,1,7,'Lie back on a bench and grip a loaded barbell. Lower the bar and, when you start to feel the tension in your triceps shift to your chest, bring the bar back toward your skull. The bar path should resemble an L shape.'),(4,3,2,8,'Contract the triceps hard and reverse the bar back to the starting position.'),(5,4,1,9,'Standing with your feet shoulder-width apart, place a barbell in front of your thighs, hands shoulder-width apart, palms facing your body, and arms fully extended.'),(6,4,2,10,'Keeping your arms straight, shrug your shoulders as high as you can. Pause, then lower to the start position.');
